import React, { Component } from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import comedy from "../images/comedy.jpg";
import music from "../images/music.jpg";
import series from "../images/series.jpg";
import movies from "../images/movies.jpg";
import gaming from "../images/gaming.jpg";
import cricket from "../images/cricket.jpg";

export class Carousel3d extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      autoplay: true,
      autoplaySpeed: 2500
    };
    return (
      <Slider {...settings}>
        <div className="int-list">
          <h3>STAND UP COMEDY</h3>
        </div>
        <div className="int-list">
          <h3>MUSIC</h3>
        </div>
        <div className="int-list">
          <h3>WEB SERIES</h3>
        </div>
        <div className="int-list">
          <h3>MOVIES</h3>
        </div>
        <div className="int-list">
          <h3>GAMING</h3>
        </div>
        <div className="int-list">
          <h3>CRICKET</h3>
        </div>
      </Slider>
    );
  }
}

export default Carousel3d;
